import React from 'react';

class Title extends React.Component {
	constructor(props){
		super(props);
		this.state = {
			counter: 0
		}
	}

	render(){
		return (
			<h1>
				<span>{this.state.counter}</span>
				Sweet Pumpkind
			</h1>
		)
	}
}
